import React from 'react'
import '../../../container/certificate.css'
import { NavLink } from 'react-router-dom'; 
function Certificate() {
  return (
    <div>
               <select onChange={(e) => window.location.href = e.target.value}>
                 <option value="/"><NavLink to="/"></NavLink></option>
                 <option value="/option1"><NavLink to="/option1"></NavLink>Certificate Genarate</option>
                 <option value="/option2"><NavLink to="/option2"></NavLink>Certificate Download</option>
               </select>
    </div>
  )
}

export default Certificate
